import Vue from 'vue';
import VueRouter from 'vue-router';
import LandingPage from 'src/main/resources/static/LandingPage.vue';
import { createApp } from 'vue'
import App from './App.vue'
import router from 'src/main/resources/router'

const app = createApp(App)

app.use(router)

app.mount('#app')
